// import java.util.Arrays;// import java.util.Collections;// import java.util.List;// import java.util.ArrayList;import java.util.HashMap;class Main {  public static void main (String[]args)   {        System.out.println ("Type END to finish");    String text = "";    Integer num = null;    String input="";     HashMap<Integer, String> dict =                new HashMap<>();    String output="";    do{    input = System.console().readLine();    try {        text = input.split ("~")[0];        num = Integer.parseInt(input.split ("~")[1]);          if (text.equals("print")){            output = dict.get(num);            System.out.println(output);            dict.remove(num);        }        else{            dict.put(num, text);        }    } catch(Exception e) {       System.out.println ("Incorrect input");     }    }while (!(input.equals("END")));    }}